INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 2, 2, 'und', 0, 'voilà, c\'est une version estivale de ma recette au thon rouge et à la vodka...\r\n\r\nIngrédients (pour 4 pers.) :\r\n\r\n400g de penne (ou autre pâte)\r\n1 bouquet de basilic\r\n4 petits filets de thon rouge\r\nhuile d\'olive\r\njus d\' 1/2 citron vert\r\nvinaigre balsamique\r\nsel, poivre, coriandre\r\nparmesan\r\nVins: Vin rouge léger style pinot noir\r\n\r\nCommencer par faire griller les filets de thon. Je les ai faits sur un grill, sans matière grasse. L\'intérieur doit rester très légèrement rouge-rosé. Retirer de feu et couper en petits cubes. Laisser refroidir et réserver. Une fois refroidi, mettre dans un bol et ajouter le sel, le poivre, la coriandre en poudre, le basilic finement haché, le jus de citron et l\'huile d\'olive sur les cubes de thon. Laisser mariner le tout env. 30min au frigo\r\n\r\nCuire les pâtes al dente, les égoutter et passer sous l\'eau froide pour arrêter la cuisson. Bien égoutter. Mélanger les pâtes avec le thon mariné délicatement pour ne pas casser tous les morceaux. Ajouter quelques fines lamelles de parmesan et un filet de vinaigre balsamique (réserve si possible, un vinaigre assez sirupeux)\r\n\r\nIl n\'y a plus qu\'à déguster! Bon appétit', '', 'filtered_html'),
('node', 'article', 0, 3, 3, 'und', 0, '------- Ingrédients (pour 2 pers.) -------\r\n\r\n140g de riz pour risotto\r\n½ oignon émincé\r\nHuile d’olive\r\n1dl de bière blanche (style Hoegaarden)\r\nBouillon de légumes\r\n2-3 càs de Stilton (au porto)\r\n1càs de parmesan râpé\r\nNoix de beurre\r\n\r\n1 bout de melon\r\nBeurre à rôtir\r\nPiment d’Espelette\r\n\r\n------- Proposition /choix du vin -------\r\n\r\nVin : Un vin blanc fruité pour accompagner le melon style Chardonnay (barrique ou non si vous le préférez moins vanillé) ou un vin rouge léger, jeune Merlot du Tessin pour ses notes de sureau ou un Pinot noir passé en barrique.\r\n\r\n---------- Préparation ----------\r\n\r\nTemps de préparation: 20min\r\nTemps de cuisson: 20min\r\n\r\nFaire chauffer l\'huile d\'olive dans une casserole, et faire fondre l\'oignon émincé sur feux doux (SANS coloration). Ajouter le riz et remuer gentiment pour le faire nacrer (les grains deviennent plus "translucides"). Mouiller avec la bière blanche et mélanger bien jusqu\'à évaporation quasi totale du liquide.\r\n\r\nPuis mouiller avec le bouillon CHAUD petit à petit (en 5-6 fois) sur feux doux (feu sur 3 chez moi, 6 étant le max) pendant environ 18 minutes. Le liquide doit juste recouvrir le riz, à peine.\r\n\r\n2 minutes avant la fin de la cuisson du risotto, ajouter la noix de beurre (ça donne du goût et un crémeux incomparables), les fromages puis laisser finir de cuire. 1-2 tours de moulin à poivre et un peu de sel éventuellement.\r\n\r\nPendant que le risotto cuit, découper de fines tranches de melon à l’aide d’une mandoline ou à la main (je l’ai fait avec un bon couteau et c’est allé). Faire chauffer le beurre à rôtir dans une poêle, y faire revenir rapidement le melon sur chaque face (env. 30sec.) Saupoudrer de piment d’Espelette et réserver.\r\n\r\nServir le risotto dans une assiette creuse avec les tranches de melons. Bonne dégustation!!!\r\n\r\nVersion imprimable\r\n-----Bon appétit!-----\r\n\r\nUn risotto sucré salé qui vous épatera, j’en suis sûr. Vous pouvez remplacer le Stilton (que tout le monde n’aime pas) par du gorgonzola plus doux. La bière amène une petite amertume (dépend aussi de la marque). Si vous n’aimez pas ça, remplacez-la simplement par du vin blanc.', 'Voici une recette qui sent bon l’été, ou du moins ce qu’il en reste (pas grand-chose parait-il…). Encore quelques melons sur les étals de nos magasins, il faut en profiter.\r\n\r\nUne recette qui marie l’onctuosité du risotto, la puissance du Stilton et la douceur du melon !', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, '------- Ingrédients (2 pers.) -------\r\n\r\n300g de filet de bœuf (Angus pour ma part)\r\n\r\n2 truffes noires\r\n½ échalote émincée finement\r\n1 noix de beurre\r\n1dl de bon Porto (vieux de préférence)\r\n1dl de bouillon de bœuf assez léger\r\n1 peu de farine\r\nSel et poivre\r\n\r\nLégumes du marché (tomates, chanterelles, asperges vertes, carotte fane,…)\r\nPignon de pin\r\n\r\n------- Proposition /choix du vin -------\r\n\r\nLa finesse de ce plat et la puissance de la truffe requièrent un vin équilibré, de beaux tanins fins. Je me tournerais aisément sur un St-Julien, vins entre les Pauillac puissants et Margaux plus fins. A occasion exceptionnelle, vin exceptionnel. Un second cru classé avec ce Château Ducru-Beaucauillou à couper le souffle. Associer ce vin au plat, le paradis assuré !\r\n\r\n---------- Préparation ----------\r\n\r\nCuisson de la viande :\r\nUne cuisson basse température pour un résultat incroyable ! Faire chauffer une poêle à blanc (sans matière grasse). Pendant ce temps, badigeonner votre filet avec un peu d’huile neutre et poivrer. Faire revenir rapidement le filet pour lui donner une belle coloration. Retirer aussitôt du feu et emballez-le dans du papier d’alu.\r\n\r\nPréchauffer le four à 70-80°C max et placer le filet pour une cuisson lente. A l’aide d’un thermomètre, vérifier la température interne du filet : 56°C pour une cuisson saignante, 58°C pour à point. Le temps de cuisson varie selon la taille de votre filet. Garder au chaud (dans mon cas, le filet était coupé en morceaux, environ 25min de cuisson). Un seul moyen d\'être sûr, le thermomètre...\r\n\r\nPour la sauce :\r\nDans une petite casserole, faire chauffer une noix de beurre et y faire revenir l’échalote émincée, sans coloration. Saupoudrer d’un peu de farine (env 1càc) et déglacer avec le Porto, puis ajouter le bouillon de bœuf. Ajouter les truffes émincées et laisser réduire de moitié. Rectifier l’assaisonnement. Attention, le bouillon de bœuf est souvent déjà bien salé !\r\n\r\nLégumes croquants :\r\nPeler les carottes (et asperges au besoin) et les faire cuire à la vapeur, al dente ! Les légumes doivent vraiment rester croquants. Laver les champignons, émincer.\r\nDans une poêle, faire chauffer un peu de beurre et y faire revenir brièvement les légumes. Saler et poivrer et réserver pour le dressage.', '', 'filtered_html'),
('node', 'article', 0, 5, 5, 'und', 0, '------- Ingrédients (4 cupcakes) -------\r\n\r\n1 oeuf\r\n75 g de farine\r\n30 g de beurre\r\n60 ml de lait\r\n85 g de sucre\r\n1/2 cc d’extrait de vanille\r\n1 cc de zeste de citron\r\n1/2 cs de graines de pavot\r\n1/2 cc de poudre à lever chimique\r\nPincée de sel\r\n\r\nLemon sauce (cela fait pour plusieurs cupcakes, en tout cas 12)\r\n30 g de beurre\r\n40 ml de jus de citron frais\r\n1 oeuf + 1 jaune\r\n100 g de sucre glace\r\n1 cs de fécule de maïs\r\n30 ml d’eau\r\n\r\nGlaçage (pas la version de base mais j’ai préféré)\r\n15 gr de beurre pommade\r\n40 gr de Philadelphia\r\n120 gr de sucre Glace\r\n2 càs de lemon sauce\r\n\r\n---------- Préparation ----------\r\n\r\nCupcakes\r\nDans un récipient, mélanger la farine, la levure chimique, la pincée de sel, les graines de pavot et le beurre à température ambiante. Malaxer avec les doigts pour effriter la pâte.\r\n\r\nDans un autre récipient, mélanger l’œuf et le sucre. Mélanger jusqu’à ce que le mélange blanchisse. Rajouter ensuite l’extrait de vanille et le zeste de citron. Ajouter cette préparation au précédent, mélanger. Ajouter ensuite progressivement le lait.\r\n\r\nLorsque la pâte est prête, garnir les moules en papier jusqu’au 3/4. Enfourner a 180° pendant 18 min environ. Laissez refroidir à température ambiante.\r\n\r\nLemon sauce\r\nMélanger le beurre mou avec le sucre glace. Rajouter l’œuf, bien mélanger, puis le jus de citron. Lisser la pâte. Dans un bol diluer la fécule de maïs avec l’eau. Ajouter ensuite le jaune. A feu doux, faire chauffer le mélange sucré au citron. En ne cessant pas de remuer, ajouter la fécule de maïs diluée. Toujours à feu doux, remuer jusqu’à ce que la sauce épaississe. Verser hors feu dans un récipient. Laisser refroidir à température ambiante, puis mettre au réfrigérateur.\r\n\r\nGlaçage\r\nPréparer le glaçage, battre le beurre et le Philadelphia, puis fouetter le mélange avec le sucre glace et le lemon sauce. Dresser avec une poche à pâtisserie sur le cupcake, mettre un filet de lemon sauce et déguster sans attendre !', 'Cupcakes oui, mais des cupcake au goût de soleil...', 'filtered_html');
