INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' page d accueil ', 0),
(2, 'node', ' salade de penne voilà c est une version estivale de ma recette au thon rouge et à la vodka ingrédients pour 4 pers 400g de penne ou autre pâte 1 bouquet de basilic 4 petits filets de thon rouge huile d olive jus d 12 citron vert vinaigre balsamique sel poivre coriandre parmesan vins vin rouge léger style pinot noir commencer par faire griller les filets de thon je les ai faits sur un grill sans matière grasse l intérieur doit rester très légèrement rougerosé retirer de feu et couper en petits cubes laisser refroidir et réserver une fois refroidi mettre dans un bol et ajouter le sel le poivre la coriandre en poudre le basilic finement haché le jus de citron et l huile d olive sur les cubes de thon laisser mariner le tout env 30min au frigo cuire les pâtes al dente les égoutter et passer sous l eau froide pour arrêter la cuisson bien égoutter mélanger les pâtes avec le thon mariné délicatement pour ne pas casser tous les morceaux ajouter quelques fines lamelles de parmesan et un filet de vinaigre balsamique réserve si possible un vinaigre assez sirupeux il n y a plus qu à déguster bon appétit plat principal pâtes ', 0),
(3, 'node', ' risotto à la bière blanche et stilton et tranches de melon poêlée  ingrédients pour 2 pers 140g de riz pour risotto ½ oignon émincé huile d olive 1dl de bière blanche style hoegaarden bouillon de légumes 23 càs de stilton au porto 1càs de parmesan râpé noix de beurre 1 bout de melon beurre à rôtir piment d espelette proposition choix du vin vin un vin blanc fruité pour accompagner le melon style chardonnay barrique ou non si vous le préférez moins vanillé ou un vin rouge léger jeune merlot du tessin pour ses notes de sureau ou un pinot noir passé en barrique préparation temps de préparation 20min temps de cuisson 20min faire chauffer l huile d olive dans une casserole et faire fondre l oignon émincé sur feux doux sans coloration ajouter le riz et remuer gentiment pour le faire nacrer les grains deviennent plus translucides mouiller avec la bière blanche et mélanger bien jusqu à évaporation quasi totale du liquide puis mouiller avec le bouillon chaud petit à petit en 56 fois sur feux doux feu sur 3 chez moi 6 étant le max pendant environ 18 minutes le liquide doit juste recouvrir le riz à peine 2 minutes avant la fin de la cuisson du risotto ajouter la noix de beurre ça donne du goût et un crémeux incomparables les fromages puis laisser finir de cuire 12 tours de moulin à poivre et un peu de sel éventuellement pendant que le risotto cuit découper de fines tranches de melon à l aide d une mandoline ou à la main je l ai fait avec un bon couteau et c est allé faire chauffer le beurre à rôtir dans une poêle y faire revenir rapidement le melon sur chaque face env 30sec saupoudrer de piment d espelette et réserver servir le risotto dans une assiette creuse avec les tranches de melons bonne dégustation version imprimable bon appétit un risotto sucré salé qui vous épatera j en suis sûr vous pouvez remplacer le stilton que tout le monde n aime pas par du gorgonzola plus doux la bière amène une petite amertume dépend aussi de la marque si vous n aimez pas ça remplacezla simplement par du vin blanc plat principal riz admin sun 5272018 1951 permalink bonne idée de mouiller le riz avec la bière log in or register to post comments  ', 0),
(4, 'node', ' filet de bœuf angus et son jus de truffes noires au vieux porto petits légumes du marché croquants  ingrédients 2 pers 300g de filet de bœuf angus pour ma part 2 truffes noires ½ échalote émincée finement 1 noix de beurre 1dl de bon porto vieux de préférence 1dl de bouillon de bœuf assez léger 1 peu de farine sel et poivre légumes du marché tomates chanterelles asperges vertes carotte fane pignon de pin proposition choix du vin la finesse de ce plat et la puissance de la truffe requièrent un vin équilibré de beaux tanins fins je me tournerais aisément sur un stjulien vins entre les pauillac puissants et margaux plus fins a occasion exceptionnelle vin exceptionnel un second cru classé avec ce château ducrubeaucauillou à couper le souffle associer ce vin au plat le paradis assuré préparation cuisson de la viande une cuisson basse température pour un résultat incroyable faire chauffer une poêle à blanc sans matière grasse pendant ce temps badigeonner votre filet avec un peu d huile neutre et poivrer faire revenir rapidement le filet pour lui donner une belle coloration retirer aussitôt du feu et emballezle dans du papier d alu préchauffer le four à 7080 c max et placer le filet pour une cuisson lente a l aide d un thermomètre vérifier la température interne du filet 56 c pour une cuisson saignante 58 c pour à point le temps de cuisson varie selon la taille de votre filet garder au chaud dans mon cas le filet était coupé en morceaux environ 25min de cuisson un seul moyen d être sûr le thermomètre pour la sauce dans une petite casserole faire chauffer une noix de beurre et y faire revenir l échalote émincée sans coloration saupoudrer d un peu de farine env 1càc et déglacer avec le porto puis ajouter le bouillon de bœuf ajouter les truffes émincées et laisser réduire de moitié rectifier l assaisonnement attention le bouillon de bœuf est souvent déjà bien salé légumes croquants peler les carottes et asperges au besoin et les faire cuire à la vapeur al dente les légumes doivent vraiment rester croquants laver les champignons émincer dans une poêle faire chauffer un peu de beurre et y faire revenir brièvement les légumes saler et poivrer et réserver pour le dressage plat principal viande ', 0),
(5, 'node', ' lemon cupcake ou quand je pique une recette à ganesha pour la bonne cause  ingrédients 4 cupcakes 1 oeuf 75 g de farine 30 g de beurre 60 ml de lait 85 g de sucre 12 cc d extrait de vanille 1 cc de zeste de citron 12 cs de graines de pavot 12 cc de poudre à lever chimique pincée de sel lemon sauce cela fait pour plusieurs cupcakes en tout cas 12 30 g de beurre 40 ml de jus de citron frais 1 oeuf 1 jaune 100 g de sucre glace 1 cs de fécule de maïs 30 ml d eau glaçage pas la version de base mais j ai préféré 15 gr de beurre pommade 40 gr de philadelphia 120 gr de sucre glace 2 càs de lemon sauce préparation cupcakes dans un récipient mélanger la farine la levure chimique la pincée de sel les graines de pavot et le beurre à température ambiante malaxer avec les doigts pour effriter la pâte dans un autre récipient mélanger l œuf et le sucre mélanger jusqu à ce que le mélange blanchisse rajouter ensuite l extrait de vanille et le zeste de citron ajouter cette préparation au précédent mélanger ajouter ensuite progressivement le lait lorsque la pâte est prête garnir les moules en papier jusqu au 34 enfourner a 180 pendant 18 min environ laissez refroidir à température ambiante lemon sauce mélanger le beurre mou avec le sucre glace rajouter l œuf bien mélanger puis le jus de citron lisser la pâte dans un bol diluer la fécule de maïs avec l eau ajouter ensuite le jaune a feu doux faire chauffer le mélange sucré au citron en ne cessant pas de remuer ajouter la fécule de maïs diluée toujours à feu doux remuer jusqu à ce que la sauce épaississe verser hors feu dans un récipient laisser refroidir à température ambiante puis mettre au réfrigérateur glaçage préparer le glaçage battre le beurre et le philadelphia puis fouetter le mélange avec le sucre glace et le lemon sauce dresser avec une poche à pâtisserie sur le cupcake mettre un filet de lemon sauce et déguster sans attendre  dessert cake ', 0),
